summary:
o	Digital business builder with clear focus on B2C marketplaces, commerce and networks;
o	Growth-minded senior executive with a solid experience as CEO, entrepreneur, investor and board member in private and public companies. 
o	Background in general management, consulting, venture capital, product management, digital media sales, marketing and business development; 
o	Well-versed in Agile Product Development Methodologies, OKR based business steering, Finance, Legal and various aspects of Licensing, Fundraising, Mergers and Acquisitions; 
o	Entrepreneurial, no-nonsense, people manager, able to develop can-do team culture, growth mindset and (over-) achieve ambitious results; 
o	Large international network and solid international experience. Successfully negotiated and closed complex deals around the world.
